export default function Navbar(){
    return(
        <div className="navbar">
            <nav className="navbar_nav">
                <div className="nav_name">
                    <h2>Blog</h2>
                </div>
                <div className="nav_right">
                    <Link to=''>Login</Link>
                    <Link to=''>Register</Link>
                </div>
                <div className='nav_right'>
                    
                </div>
            </nav>
        </div>
    );
}
